interface State {
    nextShroom: string;         /* which shroom is being shown */ 
    babyShroomDisplay: string; 
    teenShroomDisplay: string;
    daddyShroomDisplay: string;
    timePassed: number; 
    timerInterval: number;
}

 
/*
