export default defineComponent({
    name: 'FFLogo',

    // props are READ ONLY
    // @Prop({default:"none"}) babyShroomDisplay!: string
    // @Prop({default:"none"}) teenShroomDisplay!: string
    // @Prop({default:"inline"}) bigShroomDisplay!: string
